import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  MapContainer,
  TileLayer,
  Marker,
  Popup,
  Polyline
} from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  LineElement,
  PointElement,
  CategoryScale,
  LinearScale,
  TimeScale,
  Tooltip,
  Legend
} from 'chart.js';
import 'chartjs-adapter-date-fns';

ChartJS.register(
  LineElement,
  PointElement,
  CategoryScale,
  LinearScale,
  TimeScale,
  Tooltip,
  Legend
);

const App = () => {
  const [positions, setPositions] = useState([]);
  const [selected, setSelected] = useState(null);
  const [timeSeries, setTimeSeries] = useState(null);

  useEffect(() => {
    axios.get('http://localhost:5000/api/positions')
      .then(res => {
        setPositions(res.data);
      });
  }, []);

  const handleMarkerClick = (pos) => {
    setSelected(pos);

    axios.get(`http://localhost:5000/api/timeseries?time=${encodeURIComponent(pos.obsTime)}`)
      .then(response => {
        const data = response.data.map(entry => ({
          x: new Date(entry.time),
          y: entry.pressure
        }));

        setTimeSeries({
          data,
          highlightedTime: new Date(pos.obsTime)
        });
      })
      .catch(err => console.error("Error fetching timeseries:", err));
  };

  const polylinePositions = positions.map(p => [p.lat, p.lon]);

  const startIcon = new L.Icon({
    iconUrl: 'https://maps.google.com/mapfiles/ms/icons/green-dot.png',
    iconSize: [32, 32]
  });

  const endIcon = new L.Icon({
    iconUrl: 'https://maps.google.com/mapfiles/ms/icons/blue-dot.png',
    iconSize: [32, 32]
  });

  const defaultIcon = new L.Icon({
    iconUrl: 'https://maps.google.com/mapfiles/ms/icons/red-dot.png',
    iconSize: [24, 24]
  });

  return (
    <div>
      <h2 style={{ textAlign: 'center' }}>Ocean Tracker</h2>
      <MapContainer center={[positions[0]?.lat || 0, positions[0]?.lon || 0]} zoom={5} style={{ height: "500px", width: "100%" }}>
        <TileLayer
          url='https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png'
        />
        {positions.map((pos, idx) => (
          <Marker
            key={idx}
            position={[pos.lat, pos.lon]}
            icon={idx === 0 ? startIcon : idx === positions.length - 1 ? endIcon : defaultIcon}
            eventHandlers={{
              click: () => handleMarkerClick(pos)
            }}
          >
            <Popup>
              <div>
                <p><strong>Fix Time:</strong> {pos.fixTime}</p>
                <p><strong>Obs Time:</strong> {pos.obsTime}</p>
                <p><strong>Pressure:</strong> {pos.barometricPressure}</p>
              </div>
            </Popup>
          </Marker>
        ))}
        <Polyline positions={polylinePositions} color="red" />
      </MapContainer>

      {timeSeries?.data && (
        <div style={{ margin: '2rem' }}>
          <h3>Barometric Pressure (Â±3 days from selected)</h3>
          <Line
            data={{
              datasets: [
                {
                  label: 'Pressure',
                  data: timeSeries.data,
                  borderColor: 'skyblue',
                  backgroundColor: 'skyblue',
                  pointRadius: 2,
                  tension: 0.3
                },
                {
                  label: 'Selected Point',
                  data: timeSeries.data.filter(d => d.x.getTime() === timeSeries.highlightedTime.getTime()),
                  backgroundColor: 'red',
                  borderColor: 'red',
                  pointRadius: 6,
                  pointStyle: 'circle',
                  showLine: false
                }
              ]
            }}
            options={{
              responsive: true,
              plugins: {
                legend: { position: 'top' },
                tooltip: { mode: 'index', intersect: false }
              },
              scales: {
                x: {
                  type: 'time',
                  time: {
                    unit: 'day'
                  },
                  title: {
                    display: true,
                    text: 'Observation Time'
                  }
                },
                y: {
                  title: {
                    display: true,
                    text: 'Pressure (hPa)'
                  }
                }
              }
            }}
          />
        </div>
      )}
    </div>
  );
};

export default App;
